        <style>
            svg#freepik_stories-no-data:not(.animated) .animable {
                opacity: 0;
            }

            svg#freepik_stories-no-data.animated #freepik--background-complete--inject-373 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut;
                animation-delay: 0s;
            }

            svg#freepik_stories-no-data.animated #freepik--Shadow--inject-373 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
                animation-delay: 0s;
            }

            svg#freepik_stories-no-data.animated #freepik--window-no-data--inject-373 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn;
                animation-delay: 0s;
            }

            svg#freepik_stories-no-data.animated #freepik--Character--inject-373 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                animation-delay: 0s;
            }

            @keyframes zoomOut {
                0% {
                    opacity: 0;
                    transform: scale(1.5);
                }

                100% {
                    opacity: 1;
                    transform: scale(1);
                }
            }

            @keyframes slideDown {
                0% {
                    opacity: 0;
                    transform: translateY(-30px);
                }

                100% {
                    opacity: 1;
                    transform: translateY(0);
                }
            }

            @keyframes fadeIn {
                0% {
                    opacity: 0;
                }

                100% {
                    opacity: 1;
                }
            }

            @keyframes lightSpeedRight {
                from {
                    transform: translate3d(50%, 0, 0) skewX(-20deg);
                    opacity: 0;
                }

                60% {
                    transform: skewX(10deg);
                    opacity: 1;
                }

                80% {
                    transform: skewX(-2deg);
                }

                to {
                    opacity: 1;
                    transform: translate3d(0, 0, 0);
                }
            }

            svg#freepik_stories-workout.animated #freepik--background-complete--inject-6 {

                animation-delay: 0s;

                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomIn;
                animation-delay: 0s;

            svg#freepik_stories-workout.animated #freepik--Character--inject-6 {

            svg#freepik_stories-workout.animated #freepik--Dumbbell--inject-6 {

                animation-delay: 0s;

            @keyframes zoomIn {
                0% {
                    opacity: 0;
                    transform: scale(0.5);
                }

                100% {
                    opacity: 1;
                    transform: scale(1);
                }
            }

            @keyframes lightSpeedRight {
                from {
                    transform: translate3d(50%, 0, 0) skewX(-20deg);
                    opacity: 0;
                }

                60% {
                    transform: skewX(10deg);
                    opacity: 1;
                }

                80% {
                    transform: skewX(-2deg);
                }

                to {
                    opacity: 1;
                    transform: translate3d(0, 0, 0);
                }
            }

            @keyframes slideUp {
                0% {
                    opacity: 0;
                    transform: translateY(30px);

                100% {
                    opacity: 1;
                    transform: inherit;
                }
            }

        <style>
            svg#freepik_stories-personalized-workouts:not(.animated) .animable {
                opacity: 0;
            }

            svg#freepik_stories-personalized-workouts.animated #freepik--background-complete--inject-2 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
                animation-delay: 0s;
            }

            svg#freepik_stories-personalized-workouts.animated #freepik--Shadow--inject-2 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
                animation-delay: 0s;
            }

            svg#freepik_stories-personalized-workouts.animated #freepik--Drumbbell--inject-2 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn;
                animation-delay: 0s;
            }

            svg#freepik_stories-personalized-workouts.animated #freepik--screen-2--inject-2 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                animation-delay: 0s;
            }

            svg#freepik_stories-personalized-workouts.animated #freepik--screen-1--inject-2 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomIn;
                animation-delay: 0s;
            }

            svg#freepik_stories-personalized-workouts.animated #freepik--Character--inject-2 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
                animation-delay: 0s;
            }

            @keyframes lightSpeedLeft {
                from {
                    transform: translate3d(-50%, 0, 0) skewX(20deg);
                    opacity: 0;
                }

                60% {
                    transform: skewX(-10deg);
                    opacity: 1;
                }

                80% {
                    transform: skewX(2deg);
                }

                to {
                    opacity: 1;
                    transform: translate3d(0, 0, 0);
                }
            }

            @keyframes slideUp {
                0% {
                    opacity: 0;
                    transform: translateY(30px);
                }

                100% {
                    opacity: 1;
                    transform: inherit;
                }
            }

            @keyframes fadeIn {
                0% {
                    opacity: 0;
                }

                100% {
                    opacity: 1;
                }
            }

            @keyframes lightSpeedRight {
                from {
                    transform: translate3d(50%, 0, 0) skewX(-20deg);
                    opacity: 0;
                }

                60% {
                    transform: skewX(10deg);
                    opacity: 1;
                }

                80% {
                    transform: skewX(-2deg);
                }

                to {
                    opacity: 1;
                    transform: translate3d(0, 0, 0);
                }
            }

            @keyframes zoomIn {
                0% {
                    opacity: 0;
                    transform: scale(0.5);
                }

                100% {
                    opacity: 1;
                    transform: scale(1);
                }
            }
        </style>
